  <body style="text-align: center;">
    <span id="comfort">
      <img id="title" width="75%"/>
      <button id="play">
        <img id="playOutline" />
        <img id="playText" />
      </button>
      <button id="playArea"></button>
      </button>
      <div id="game">
        <span class="bg" id="bg1"></span>
        <span class="bg" id="bg2"></span>
        <canvas id="gc" width="400" height="400"></canvas>
        <span id="blur" width="400" height="400">
          <span id="rel">
            <a id="pause">PAUSED</a>
            <a id="Pscore">17</a>
            <div id="res">
              Press <a class="kb">ESC</a>, <a class="kb">P</a>, or <a class="kb">☰</a> to resume
            </div>
          </span>
        </span>
        <span id="Cdown-par" width="400" height="400">
          <a id="Cdown">
            <img id="CDimg" src="" />
          </a>
        </span>
        <button class="controls" id="up"><span id="arrUp" class="arrow"></span></button>
        <button class="controls" id="left"><span id="arrLft" class="arrow"></span></button>
        <button class="controls" id="right"><span id="arrRgt" class="arrow"></span></button>
        <button class="controls" id="down"><span id="arrDwn" class="arrow"></span></button>
      </div>
      <img id="trans" width="100%"/>
    </span>
    <div id="sfx"></div>
    <style>
      :root {
        --purp1: hsl(292, 97%, 86%);
        --purp2: hsl(292, 96%, 74%);
        --purp3: hsl(292, 95%, 62%);
        --dark1: hsl(0, 0%, 27%);
        --dark2: hsl(0, 0%, 19%);
        --dark3: hsl(0, 0%, 13%);
        --dark4: hsl(0, 0%, 9%);
      }
      #sfx {
        position: fixed;
        display: none;
        z-index: -600;
      }
      #res {
        position: absolute;
        display: inline-block;
        font-family: Arial, Helvetica, sans-serif;
        position: fixed;
        top: 75%;
        left: 50%;
        text-align: center;
        transform: translate(-50%, -50%);
        font-size: 2.75cqw;
        touch-action: manipulation;
      }
      .kb {
        font-weight: bold;
        touch-action: manipulation;
      }
      #Cdown-par {
        position: absolute;
        top: 50%;
        left: 50%;
        width: 46.9%;
        height: 46.9%;
        background: none;
        border: none;
        transform: translate(-50%, -50%);
        touch-action: manipulation;
      }
      #Cdown {
        position: absolute;
        width: 60%;
        font-size: 12cqw;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
        touch-action: manipulation;
      }
      #CDimg {
        image-rendering: optimizeSpeed;
        image-rendering: -moz-crisp-edges;
        image-rendering: -o-crisp-edges;
        image-rendering: -webkit-optimize-contrast;
        image-rendering: pixelated;
        image-rendering: optimize-contrast;
        position: absolute;
        margin: 0px;
        padding: 0px;
        top: 50%;
        left: 50%;
        height: 1em;
        transform: translate(-50%, -50%);
        touch-action: manipulation;
      }
      #Pscore img {
        image-rendering: optimizeSpeed;
        image-rendering: -moz-crisp-edges;
        image-rendering: -o-crisp-edges;
        image-rendering: -webkit-optimize-contrast;
        image-rendering: pixelated;
        image-rendering: optimize-contrast;
        touch-action: manipulation;
      }
      #pause {
        position: absolute;
        width: 60%;
        top: 33%;
        left: 50%;
        font-size: 6cqw;
        font-family: Arial, Helvetica, sans-serif;
        text-align: center;
        transform: translate(-50%, -50%);
        font-weight: bold;
        color: hsl(272, 100%, 60%);
        -webkit-text-stroke-width: 0.33cqw;
        -webkit-text-stroke-color: hsl(272, 80%, 50%);
        touch-action: manipulation;
      }
      #Pscore {
        position: absolute;
        width: 60%;
        top: 50%;
        left: 50%;
        font-size: 6cqw;
        font-family: Arial, Helvetica, sans-serif;
        text-align: center;
        transform: translate(-50%, -50%);
        font-weight: bold;
        color: hsl(222, 100%, 50%);
        -webkit-text-stroke-width: 0.33cqw;
        -webkit-text-stroke-color: hsl(222, 100%, 40%);
        touch-action: manipulation;
      }
      #rel {
        position: relative;
        display: inline-block;
        width: 100%;
        height: 100%;
        touch-action: manipulation;
      }
      #blur {
        position: absolute;
        top: 50%;
        left: 50%;
        width: 46.9%;
        height: 46.9%;
        background-color: rgba(150, 150, 150, 0.33);
        border: none;
        display: none;
        backdrop-filter: blur(2px);
        transform: translate(-50%, -50%);
        touch-action: manipulation;
      }
      .controls {
        display: inline-block;
        background-color: var(--purp2);
        height: 7.6%;
        width: 7.6%;
        text-align: center;
        font-size: 40px;
        padding: 0px;
        border-style: solid;
        border-width: 4px;
        border-top-color: var(--purp3);
        border-left-color: var(--purp3);
        border-right-color: var(--purp1);
        border-bottom-color: var(--purp1);
        touch-action: manipulation;
      }
      .arrow {
        background-size: contain;
        background-repeat: no-repeat;
        background-position: center;
        width: 69.23%;
        height: 69.23%;
        touch-action: manipulation;
      }
      #up span {
        position: fixed;
        display: inline-block;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%) rotate(270deg);
        touch-action: manipulation;
      }
      #down span {
        position: fixed;
        display: inline-block;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%) rotate(270deg);
        touch-action: manipulation;
      }
      #left span {
        position: fixed;
        display: inline-block;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%) rotate(0deg);
        touch-action: manipulation;
      }
      #right span {
        position: fixed;
        display: inline-block;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%) rotate(0deg);
        touch-action: manipulation;
      }
      body {
        background-color: #000;
        touch-action: manipulation;
      }
      #bg1 {
        background-color: var(--dark2);
        width: 89.2%;
        height: 89.2%;
        transition-duration: 3s;
        touch-action: manipulation;
      }
      #bg2 {
        background-color: var(--dark3);
        width: 67.5%;
        height: 67.5%;
        transition-duration: 3s;
        touch-action: manipulation;
      }
      .bg {
        position: fixed;
        display: inline-block;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
        transition-property: width, height;
        transition-timing-function: ease-in-out;
        touch-action: manipulation;
      }
      #gc {
        position: fixed;
        top: 50%;
        left: 50%;
        width: 46.9%;
        height: 46.9%;
        transform: translate(-50%, -50%);
        touch-action: manipulation;
      }
      #right {
        position: fixed;
        top: 50%;
        right: 50%;
        transform: translate(423.1%, -50%);
        touch-action: manipulation;
      }
      #left {
        position: fixed;
        top: 50%;
        left: 50%;
        transform: translate(-423.1%, -50%);
        touch-action: manipulation;
      }
      #up {
        position: fixed;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -423.1%);
        touch-action: manipulation;
      }
      #down {
        position: fixed;
        bottom: 50%;
        left: 50%;
        transform: translate(-50%, 423.1%);
        touch-action: manipulation;
      }
      #game {
        display: none;
        width: 100%;
        height: 100%;
        touch-action: manipulation;
      }
      #title {
        image-rendering: optimizeSpeed;
        image-rendering: -moz-crisp-edges;
        image-rendering: -o-crisp-edges;
        image-rendering: -webkit-optimize-contrast;
        image-rendering: pixelated;
        image-rendering: optimize-contrast;
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
        transition-property: transform, top, width;
        transition-duration: 1s;
        transition-timing-function: ease-in-out;
        touch-action: manipulation;
      }
      #play {
        display: none;
        position: absolute;
        top: 60%;
        left: 50%;
        transform: translate(-50%, -50%);
        padding: none;
        width: 30%;
        border: none;
        background: none;
        touch-action: manipulation;
      }
      #playArea {
        display: none;
        position: absolute;
        top: 60%;
        left: 50%;
        transform: translate(-50%, -50%);
        padding: none;
        height: 16.25%;
        width: 32.5%;
        border: none;
        background: none;
        touch-action: manipulation;
      }
      #playOutline {
        image-rendering: optimizeSpeed;
        image-rendering: -moz-crisp-edges;
        image-rendering: -o-crisp-edges;
        image-rendering: -webkit-optimize-contrast;
        image-rendering: pixelated;
        image-rendering: optimize-contrast;
        border: none;
        position: absolute;
        top: 50%;
        left: 50%;
        width: 100%;
        transform: translate(-50%, -50%);
        opacity: 0;
        transition-property: opacity;
        transition-duration: 1s;
        touch-action: manipulation;
      }
      #playText {
        image-rendering: optimizeSpeed;
        image-rendering: -moz-crisp-edges;
        image-rendering: -o-crisp-edges;
        image-rendering: -webkit-optimize-contrast;
        image-rendering: pixelated;
        image-rendering: optimize-contrast;
        border: none;
        position: absolute;
        top: 50%;
        left: 50%;
        width: 100%;
        transform: translate(-50%, -50%);
        opacity: 0;
        transition-property: opacity;
        transition-duration: 1s;
        touch-action: manipulation;
      }
      #trans {
        image-rendering: optimizeSpeed;
        image-rendering: -moz-crisp-edges;
        image-rendering: -o-crisp-edges;
        image-rendering: -webkit-optimize-contrast;
        image-rendering: pixelated;
        image-rendering: optimize-contrast;
        position: fixed;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
        width: 100%;
        border: none;
        touch-action: manipulation;
      }
      #comfort {
        display: inline-block;
        background-color: black;
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
        touch-action: manipulation;
      }

        linear: t => t,

        easeInSine: t => 1 - Math.cos(t * Math.PI / 2),

        },
        easeInCirc: t => 1 - Math.sqrt(1 - t*t),

      function tween(start, end, steps, fss = 2, fes = 2, easing = 'linear') {
        if (steps < fss + fes + 1) {
          throw new Error("Not enough steps for fixed start/end steps.");
        }

        const easeFn = easingFunctions[easing];
        if (!easeFn) {
          throw new Error(`Easing function "${easing}" not found.`);
        }

        const result = [];
        const tweenSteps = steps - fss - fes;

        for (let i = 0; i < fss; i++) {
          result.push(start);
        }

        for (let i = 1; i <= tweenSteps; i++) {
          const t = i / (tweenSteps + 1);
          const easedT = easeFn(t);
          result.push(start + (end - start) * easedT);
        }

        for (let i = 0; i < fes; i++) {
          result.push(end);
        }

        return result;
      }

      function circle(x, y, rad, s) {
        ctx.beginPath();
        ctx.arc(x, y, rad, 0, Math.PI * 2);

          ctx.lineWidth = s;
          ctx.stroke();
        }
        ctx.fill();

      function semiCirc(x, y, rad, direct, sThick, sType) {
        let ln = {};
        let arc = {
          "u": {
            "sa": Math.PI,
            "ea": 2 * Math.PI
          },
          "d": {
            "sa": 0,
            "ea": Math.PI
          },
          "l": {
            "sa": 0.5 * Math.PI,
            "ea": 1.5 * Math.PI
          },
          "r": {
            "sa": 1.5 * Math.PI,
            "ea": 0.5 * Math.PI
          }
        }
        ctx.beginPath();
        
        ctx.arc(x, y, rad, arc[direct].sa, arc[direct].ea);
        ln = getArc((x, y, rad, arc[direct].sa, arc[direct].ea));
        
        if(sThick) {
          ctx.strokeStyle = "black";
          ctx.lineWidth = sThick;
          ctx.stroke();
        }
        ctx.fill();

      function rect(x, y, width, height, stroke, sides) {
        if(stroke) {
          ctx.strokeStyle = "black";
          ctx.lineWidth = stroke;
          ctx.beginPath();
          if (sides && (sides.includes("u") || sides.includes("d") || sides.includes("l") || sides.includes("r"))) {
            if(sides.includes("u")) {
              ctx.moveTo(x, y);
              ctx.lineTo(x + width, y);
            }
            if(sides.includes("d")) {
              ctx.moveTo(x, y + height);
              ctx.lineTo(x + width, y + height);
            }
            if(sides.includes("l")) {
              ctx.moveTo(x, y);
              ctx.lineTo(x, y + height);
            }
            if(sides.includes("r")) {
              ctx.moveTo(x + width, y);
              ctx.lineTo(x + width, y + height);
            }
          } else {
            ctx.moveTo(x, y)
            ctx.lineTo(x, y + height);
            ctx.lineTo(x + width, y + height);
            ctx.lineTo(x + width, y);
            ctx.lineTo(x, y);
          }
          ctx.stroke();
        }
        ctx.fillRect(x, y, width, height);
      }
      function eyes(pupil) {
        let head = trail[trail.length - 1];
        let pupRad = 4;
        ctx.fillStyle = "White";
        circle((head.x * 20) + 10, (head.y * 20) + 10, 7, 2);
        ctx.fillStyle = "Black";
        if(pupil) {
          if(pupil === "shrink") {
            pupRad = 2;
          }
          if(!isNaN(pupil)) {
            pupRad = pupil;
          }
          if(Array.isArray(pupil) && pupil[0].toLowerCase() === "dead" && !isNaN(pupil[1])) {
            let cx = (head.x + 0.5) * 20;
            cx += xv;
            let cy = (head.y + 0.5) * 20;
            cy += yv;
            let rad = pupil[1] / Math.sqrt(2);
            let prevAlph = ctx.globalAlpha;

            let c1x = cx - rad;
            let c1y = cy - rad;

            let c2x = cx + rad;
            let c2y = cy + rad;

            let c3x = cx + rad;
            let c3y = cy - rad;

            let c4x = cx - rad;
            let c4y = cy + rad;

            ctx.beginPath();

            ctx.moveTo(c1x, c1y);
            ctx.lineTo(c2x, c2y);

            ctx.moveTo(c3x, c3y);
            ctx.lineTo(c4x, c4y);

            ctx.lineWidth = 2;
            ctx.globalAlpha = 0.25 * pupil[1];
            ctx.stroke();
            
            ctx.globalAlpha = 1 - ctx.globalAlpha;
            circle(cx, cy, 2);

            ctx.globalAlpha = prevAlph;
            
            return;
          }
        }
        if(xv == 1) {
          circle((head.x * 20) + 12.5, (head.y * 20) + 10, pupRad);
        } else if(xv == -1) {
          circle((head.x * 20) + 7.5, (head.y * 20) + 10, pupRad);
        } else if(yv == 1) {
